import React, {Component} from 'react';
import {BrowserRouter, Route, Link} from 'react-router-dom';

class Home extends React.Component {
  render () {
    return (
      <div>
        <header>
          <h1>User List</h1>
        </header>

        <main>
          <table>
            <thead>
              <tr>
                <th>用户ID</th>
                <th>用户名</th>
                <th>性别</th>
                <th>年龄</th>
              </tr>
            </thead>

            <tbody>
              {
                userList.map((user) => {
                  return (
                    <tr key={user.id}>
                      <td>{user.id}</td>
                      <td>{user.name}</td>
                      <td>{user.gender}</td>
                      <td>{user.age}</td>
                    </tr>
                  );
                })
              }
            </tbody>
          </table>
          <Link to="/useradd">Add User</Link>
        </main>
      </div>
    );
  }
}

class UserAdd extends React.Component {
  render () {
    return (
      <div>
        <header>
          <h1>Add User</h1>
        </header>

        <main>
          <form>
            <label>First Name：</label>
            <input type="text"/>
            <br/>
            <label>Last Name：</label>
            <input type="text"/>
            <br/>
            <label>Age：</label>
            <input type="number"/>
            <br/>
            <label>Gender：</label>
            <select>
              <option value="">Option</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="unknown">Unknown</option>
            </select>
            <br/>
            <label>Password：</label>
            <input type="number"/>
            <br/>
            <label>Repeat password：</label>
            <input type="number"/>
            <br/>
            <input type="submit" value="submit"/>
          </form>
        </main>
      </div>
    );
  }
}

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <Route exact={true} path="/" component={Home} />
          <Route path="/useradd" component={UserAdd} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
